import React from 'react';
import HeroInfo from './HeroInfo';

const Content = () => {
        return (
            <div>
              <HeroInfo
                image="/path/to/superman-image.jpg"
                name="Superman"
              />
              <HeroInfo
                image="/path/to/batman-image.jpg"
                name="Batman"
              />
              <HeroInfo
                image="/path/to/wonderwoman-image.jpg"
                name="Wonder Woman"
              />
            </div>
          );
}
export default Content;
